import React from 'react';
import CardsEvent from '../template/cards/CardsEvent';
import CardsDrinks from '../template/cards/CardsDrinks';
import CardsName from '../template/cards/CardsName';
import CardsCovid from '../template/cards/CardsCovid';
import { Link } from 'react-router-dom';

export default function Home() {
  return (
    <>
      <Link to="/event" className="col-lg-6 col-md-6 col-sm-6"><CardsEvent /></Link>

      <div className="col-lg-6 col-md-6 col-sm-6"><CardsDrinks /></div>
      <div className="col-lg-6 col-md-6 col-sm-6"><CardsCovid /></div>
      <div className="col-lg-6 col-md-6 col-sm-6"><CardsName /></div>
    </>
  );

}
